import React from 'react'
import BtnLink from "../../Layouts/BtnLink/BtnLink"
import styles from './Nav.module.scss'

const Nav = () => {
  const linkList = [
    { title: 'Каталог провайдеров', href: '/' },
    { title: 'Рейтинг провайдеров', href: '/' },
    { title: 'Акции', href: '/' },
    { title: 'Тарифы', href: '/' },
    { title: 'Сравнить тарифы', href: '/' },
  ]
  return (
    <div className={ styles.nav }>
      { linkList.map(({ title, href }, key) =>
        <BtnLink title={ title } href={ href } key={ key } color='red'/>
      ) }
    </div>
  )
}

export default Nav
